import { makeStyles } from '@mui/styles';
export default makeStyles((theme) => ({
  mainContainer: {
    minWidth: '100%',
    minHeight: '90vh',
    height: '100%',
    [theme.breakpoints.down('sm')]: {
      minHeight: '35rem',
      minWidth: '24rem',
    },
  },
  footer:{
    marginTop:`calc(5% + 60px)`,
   bottom:0
  }
}));
